import React, { useEffect,useState } from "react";
import { Loader } from "google-maps";
import { key } from "./misc/config";
import "./App.css";
import Location from "./components/Location";
function App() {
  const [google,setGoogle] = useState('hi')
  const [map,setMap] = useState('lol')
  const loadMap = async () => {
    const load = new Loader(key.google);
    setGoogle(await load.load());
    console.log(google)
    setMap(new google.maps.Map(document.getElementById("map")), {
      center: { lat: 40, lng: -100 },
      scrollwheel: false,
      zoom: 5
    });
  }
  useEffect(() => {
    loadMap()
  }, []);
  return (
    <div className="AppRoot">
      <Location google={google,map}/>
    </div>
  );
}

export default App;
